import React from 'react';

function Navbar() {
  return (
    <div>
      <div>
        <ul>
          <li>About Me</li>
          <li>Projects</li>
          <li>Ethics</li>
          <li>Reach Out</li>
        </ul>
      </div>
    </div>
  );
}

export default Navbar;
